INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1, "春咲 ひより", 0, 1, 0, 1.4, 1001, 1, 0, 2, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1, "草野 優衣", 0, 1, 0, 1.4, 1002, 1, 0, 2, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("フェンシングを始めてみては？", 0, 0, 1, "士条 怜", 0, 1, 0, 1.4, 1003, 1, 0, 2, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ねぇ、にいちゃん！", 0, 0, 1, "穂高 みそぎ", 0, 1, 0, 1.5, 1004, 1, 0, 2, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("風宮あかりです", 0, 0, 1, "風宮 あかり", 0, 1, 0, 1.4, 1006, 1, 0, 2, "ねぇ…", "私といっしょに…\nいかない？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("出雲宮子なのー", 0, 0, 1, "出雲 宮子", 0, 1, 0, 1.5, 1007, 1, 0, 2, "プリンたべたいのー", "食べ物の恨みは怖いのー");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ボクは虹村雪。", 0, 0, 1, "虹村 雪", 0, 1, 0, 1.4, 1008, 1, 0, 2, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("フッ…聞いて後悔するがいい！", 0, 0, 1, "柊杏奈", 0, 1, 0, 1.4, 1009, 1, 0, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1, "姫宮 真歩", 0, 1, 0, 1.5, 1010, 1, 0, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("衣之咲璃乃です！", 0, 0, 1, "衣之咲 璃乃", 0, 1, 0, 1.4, 1011, 1, 0, 2, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1, "柏崎 初音", 0, 1, 0, 1.4, 1012, 1, 0, 2, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ちょす！\n美波鈴奈だよ～♪", 0, 0, 1, "美波 鈴奈", 0, 1, 0, 1.4, 1016, 1, 0, 2, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("はいたーい。\n喜屋武香織さー。", 0, 0, 1, "喜屋武 香織", 0, 1, 0, 1.4, 1017, 1, 0, 2, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("支倉伊緒です。", 0, 0, 1, "支倉 伊緒", 0, 1, 0, 1.4, 1018, 1, 0, 2, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1, "茜 ミミ", 0, 1, 0, 1.5, 1020, 1, 0, 2, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1, "栗林 くるみ", 0, 1, 0, 1.5, 1021, 1, 0, 2, "あの……\nふぇ……", "ふぇぇぇぇぇん……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("風宮よりです。\nあああああ！", 0, 0, 1, "風宮 より", 0, 1, 0, 1.4, 1022, 1, 0, 2, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1, "北条 綾音", 0, 1, 0, 1.5, 1023, 1, 0, 2, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1, "天野 すずめ", 0, 1, 0, 1.4, 1025, 1, 0, 2, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("……クスクス…私は\n…倉石恵理子……", 0, 0, 1, "倉石 恵理子", 0, 1, 0, 1.4, 1027, 1, 0, 2, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1, "佐々木 咲恋", 0, 1, 0, 1.4, 1028, 1, 0, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("桜井望だよ！\nよろしくねっ", 0, 0, 1, "桜井 望", 0, 1, 0, 1.4, 1029, 1, 0, 2, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("デケデケデンっ！", 0, 0, 1, "ニノン・ジュベール", 0, 1, 0, 1.4, 1030, 1, 0, 2, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1, "上喜 しのぶ", 0, 1, 0, 1.4, 1031, 1, 0, 2, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1, "野戸まひる", 0, 1, 0, 1.5, 1033, 1, 0, 2, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1, "綾瀬 ゆかり", 0, 1, 0, 1.4, 1034, 1, 0, 2, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("氷川鏡華…です", 0, 0, 1, "氷川 鏡華", 0, 1, 0, 1.5, 1036, 1, 0, 2, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("柏崎…栞です。", 0, 0, 1, "柏崎 栞", 0, 1, 0, 1.4, 1038, 1, 0, 2, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ふ、双葉碧です。", 0, 0, 1, "双葉 碧", 0, 1, 0, 1.4, 1040, 1, 0, 2, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("三角千歌です。", 0, 0, 1, "三角 千歌", 0, 1, 0, 1.4, 1042, 1, 0, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("安芸真琴だ。", 0, 0, 1, "安芸 真琴", 0, 1, 0, 1.4, 1043, 1, 0, 2, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("わらわこそは夜を総べる者！", 0, 0, 1, "イリヤ・オーンスタイン", 0, 1, 0, 1.4, 1044, 1, 0, 2, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("そこで騎士は妖精を乱暴に……", 0, 0, 1, "遠見 空花", 0, 1, 0, 1.4, 1045, 1, 0, 2, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1, "宮坂たまき", 0, 1, 0, 1.4, 1046, 1, 0, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("大神美冬よ！", 0, 0, 1, "大神 美冬", 0, 1, 0, 1.4, 1048, 1, 0, 2, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("星野静流だよ！", 0, 0, 1, "星野静流", 0, 1, 0, 1.4, 1049, 1, 0, 2, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("アタシは玉泉美咲。", 0, 0, 1, "玉泉美咲", 0, 1, 0, 1.5, 1050, 1, 0, 2, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("？？？", 0, 0, 1, "リマ", 0, 1, 0, 1.4, 1052, 1, 0, 2, "？？？？", "？？？？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 0, 1, "モニカ・ヴァイスヴィント", 0, 1, 0, 1.5, 1053, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 0, 1, "ペコリーヌ", 0, 1, 0, 1.5, 1058, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 0, 1, "コッコロ", 0, 1, 0, 1.5, 1059, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 0, 1, "キャル", 0, 1, 0, 1.5, 1060, 1, 0, 2, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる");
